-- Triggers structure for table order
-- ----------------------------
DROP TRIGGER IF EXISTS `trigger_create_order`;
delimiter ;;
CREATE TRIGGER `trigger_create_order` AFTER INSERT ON `order` FOR EACH ROW BEGIN 
		UPDATE Inventory 
		SET quantity = quantity - 1 
		WHERE productId = NEW.productId
		AND warehouseId = NEW.warehouseId;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table order
-- ----------------------------
DROP TRIGGER IF EXISTS `trigger_delete_order`;
delimiter ;;
CREATE TRIGGER `trigger_delete_order` BEFORE DELETE ON `order` FOR EACH ROW BEGIN 
		UPDATE Inventory 
		SET quantity = quantity + 1 
		WHERE productId = OLD.productId
		AND warehouseId = OLD.warehouseId;
END
;;
delimiter ;

